import { useState } from 'react'
import './App.css';
import ClassComponent from './ClassComponent'

function App() {
  const [count, setCount] = useState(0)
  return (
    <div className="App">
      <h1>John Weak</h1>
      <button onClick={() => { setCount(count + 1) }}>Click</button>
      <ClassComponent count={count} setCount={() => { setCount(count + 1) }} />
    </div>
  );
}

export default App;
